import React, { useState } from 'react';
import { useAuth } from '../contexts/TokenAuthContext';
import './AuthGate.css';

const AuthGate = ({ children }) => {
  const { 
    user, 
    loading, 
    authError, 
    tokenValid, 
    isAuthenticated, 
    signIn, 
    signOut, 
    retryAuth 
  } = useAuth();

  const [showManualToken, setShowManualToken] = useState(false);
  const [manualToken, setManualToken] = useState('');
  const [validatingManual, setValidatingManual] = useState(false);

  // If still loading, show loading screen
  if (loading) {
    return (
      <div className="auth-gate">
        <div className="auth-container">
          <div className="auth-header">
            <h1>Private Banking Advisor Copilot</h1>
            <p>Initializing secure authentication...</p>
          </div>
          <div className="loading-spinner">
            <div className="spinner"></div>
          </div>
        </div>
      </div>
    );
  }

  // If authenticated, show the main application
  if (isAuthenticated && tokenValid) {
    return (
      <div>
        <div className="auth-status">
          <span>✓ Authenticated as {user.email}</span>
          <button onClick={signOut} className="sign-out-btn">Sign Out</button>
        </div>
        {children}
      </div>
    );
  }

  // Authentication required screen
  return (
    <div className="auth-gate">
      <div className="auth-container">
        <div className="auth-header">
          <h1>Private Banking Advisor Copilot</h1>
          <p>Secure authentication required to access the application</p>
        </div>

        {authError && (
          <div className="auth-error">
            <p>⚠️ {authError}</p>
            <button onClick={retryAuth} className="retry-btn">
              Retry Authentication
            </button>
          </div>
        )}

        <div className="auth-methods">
          <div className="auth-method primary">
            <h3>Google Account Authentication</h3>
            <p>Sign in with your authorized Google account to access the advisor copilot.</p>
            <button onClick={signIn} className="google-signin-btn">
              <svg width="18" height="18" viewBox="0 0 24 24">
                <path fill="#4285F4" d="M22.56 12.25c0-.78-.07-1.53-.2-2.25H12v4.26h5.92c-.26 1.37-1.04 2.53-2.21 3.31v2.77h3.57c2.08-1.92 3.28-4.74 3.28-8.09z"/>
                <path fill="#34A853" d="M12 23c2.97 0 5.46-.98 7.28-2.66l-3.57-2.77c-.98.66-2.23 1.06-3.71 1.06-2.86 0-5.29-1.93-6.16-4.53H2.18v2.84C3.99 20.53 7.7 23 12 23z"/>
                <path fill="#FBBC05" d="M5.84 14.09c-.22-.66-.35-1.36-.35-2.09s.13-1.43.35-2.09V7.07H2.18C1.43 8.55 1 10.22 1 12s.43 3.45 1.18 4.93l2.85-2.22.81-.62z"/>
                <path fill="#EA4335" d="M12 5.38c1.62 0 3.06.56 4.21 1.64l3.15-3.15C17.45 2.09 14.97 1 12 1 7.7 1 3.99 3.47 2.18 7.07l3.66 2.84c.87-2.6 3.3-4.53 6.16-4.53z"/>
              </svg>
              Sign in with Google
            </button>
          </div>

          <div className="auth-divider">
            <span>OR</span>
          </div>

          <div className="auth-method secondary">
            <h3>Service Account Token</h3>
            <p>If you have a valid identity token for the backend service, enter it below:</p>

            {!showManualToken ? (
              <button 
                onClick={() => setShowManualToken(true)}
                className="manual-token-btn"
              >
                Use Service Account Token
              </button>
            ) : (
              <div className="manual-token-form">
                <textarea
                  value={manualToken}
                  onChange={(e) => setManualToken(e.target.value)}
                  placeholder="Paste your identity token here..."
                  rows={4}
                  className="token-input"
                />
                <div className="manual-token-actions">
                  <button 
                    onClick={handleManualToken}
                    disabled={!manualToken.trim() || validatingManual}
                    className="validate-token-btn"
                  >
                    {validatingManual ? 'Validating...' : 'Validate Token'}
                  </button>
                  <button 
                    onClick={() => {
                      setShowManualToken(false);
                      setManualToken('');
                    }}
                    className="cancel-btn"
                  >
                    Cancel
                  </button>
                </div>
              </div>
            )}
          </div>
        </div>

        <div className="auth-help">
          <details>
            <summary>How to get a service account token</summary>
            <div className="help-content">
              <p>If you need to use a service account token, you can generate one using:</p>
              <code>
                gcloud auth print-identity-token --audiences=https://apialchemistproject-backend-608187465720.us-central1.run.app
              </code>
              <p>Make sure you have the appropriate IAM permissions for the backend service.</p>
            </div>
          </details>
        </div>
      </div>
    </div>
  );

  async function handleManualToken() {
    if (!manualToken.trim()) return;

    setValidatingManual(true);
    try {
      // Here we would validate the manual token
      // For now, we'll store it and let the auth context validate it
      localStorage.setItem('gcp_identity_token', manualToken.trim());
      await retryAuth();
    } catch (error) {
      console.error('Manual token validation failed:', error);
    } finally {
      setValidatingManual(false);
    }
  }
};

export default AuthGate;
